import React, { Component } from 'react';

import { PortFolioList } from '../data/portfolioList';

export default (props) => {

    PortFolioList.map((portfolio) => {
        return (
            <div className="main-content">
                <div className="container">
                    <h2>{portfolio.name}</h2>
                </div>
            </div>
        )
    });
    return (
        <div className="main-content">
            <div className="container">
                <h2>{props.title}</h2>
            </div>
        </div>
    );
}
